import React from 'react';
import './Commands.css'

const commands = [
  {
    name: '핑',
    description: '봇의 핑을 알려줍니다.'
  },
  {
    name: '봇정보',
    description: '봇의 정보를 보여줍니다.'
  },
  {
    name: '청소 (개수)',
    description: '채팅창을 청소 합니다.'
  },
  {
    name: '추방 (유저)',
    description: '유저를 추방합니다.'
  },
  {
    name: '밴 (유저)',
    description: '유저를 밴합니다.'
  }
]

function Commands() {
  return (
    <div className='Commands'>
      {commands.map(({ name }, i) => (
        <React.Fragment key={i}>
          <h3>{name}</h3>
        </React.Fragment>
      ))}
    </div>
  );
}

export default Commands;
